script: |
  super -f text -I q5185.spq | sort > q5185.out

inputs:
  - name: q5185.spq
    data: |
      SELECT col0 * col0 + tab0.col0 FROM tab0 (FORMAT parquet) WHERE NOT ( NULL ) NOT IN ( col0 + col0 * - col1 ) AND NOT ( NULL ) NOT BETWEEN NULL AND tab0.col1;
  - name: tab0

outputs:
  - name: q5185.out
    data: |
